import React, { useState, useContext } from "react";
import { Redirect, useHistory } from "react-router-dom";
import { userContext } from "../../Context/userProvider";

const Logout = () => {
    const { handleLogOut } = useContext(userContext);
    handleLogOut();
    return <Redirect to="/" />;
};

export default Logout;
